memo = {}
def numWays(width, height, badList):
    badPath = set()
    for bad in badList:
        badCoord = [int(coordStr) for coordStr in bad.split()]
        if len(badCoord) != 4:
            continue

        badPath.add((badCoord[0], badCoord[1], badCoord[2], badCoord[3]))
        badPath.add((badCoord[2], badCoord[3], badCoord[0], badCoord[1]))

    def validPath(srcCol, srcRow, dstCol, dstRow):
        if (srcCol, srcRow, dstCol, dstRow) in badPath:
            return False
        return True

    def dp(col, row):
        if (col, row) in memo:
            return memo[(col, row)]

        if col == 0 and row == 0:
            return 1

        colWays = 0
        rowWays = 0
        if col > 0 and validPath(col, row, col - 1, row):
            colWays = dp(col - 1, row)
            memo[(col - 1, row)] = colWays

        if row > 0 and validPath(col, row, col, row - 1):
            rowWays = dp(col, row - 1)
            memo[(col, row - 1)] = rowWays

        return colWays + rowWays


    return dp(width, height)




